import Home from './Home';
import Checker from './Checker';
import React from 'react'
import {
    BrowserRouter as R,Link,
    Switch,
    Route,
} from "react-router-dom";
import './checker.css'

const Nav = () => {
    return (
        <>
            <R>
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/.box{

    background-color: white;
    width: 300px;
    border: 2px solid black;
    padding: 50px;
    margin-left: 33%;
    margin-top: 6%;
    height: 300px;
}check">Wheather Checker</Link>
                        </li>
                    </ul>
                </nav>

                <Switch>
                    <Route exact path="/" component={Home}></Route>
                    <Route path="/check" component={Checker}></Route>
                </Switch>
            </R >
        </>
    )
}

export default Nav
